a:260:{i:0;a:1:{s:2:"id";s:19:"2390916622800856948";}i:1;a:1:{s:10:"short_code";s:11:"CEuPgA1nyd0";}i:2;a:1:{s:12:"created_time";i:1599239493;}i:3;a:1:{s:7:"caption";s:1379:"Sunrise is quiet on the windswept sands of El Mirage. With the exception of the occasional cough to life of pistons moving against cool steel it‚Äôs eerily silent. If you listen closely you can hear the winds gently whispering stories across the great expanse. The sun peeks hesitantly above the mountains to the east and the light adds a glow of promise of things to come as the dust gently stirs to life. You can feel the history and magic of these hallowed grounds as the dust from bygone races swirl quietly, the warmth of the first rays gradually emerging. As much as the racing on these historic sands are incredible, the moments of quiet and connection are, to me anyway, often even more magical and memorable. You feel a connection to the land and take comfort in the presence of like-minded friends‚Äìold and new. These are the memories that I will cherish through challenging days and will look forward to experiencing again. These are what keep me moving toward tomorrow.
